Steel packing 🔥🔥

@sundaysteeloc has been blowing up and this past Sunday was probably the most packed I’ve seen. Got there late with my RWB but was great seeing a few friends as always and solid collection of cars to match. 👊🏾

#sundaysteeloc #jonsibal #bodenautohaus #rwb #porsche #vorsteiner #astonmartin #bbswheels #hrewheels #964 #aircooled #rauhart #roughworld

Maserati MCXtrema 💣

@maserati dropped a bomb at @thequailevents with this 730hp track-only beast 😍 A successor to the MC12 Corsa, the styling in my opinion is one of the best designs that came out of the brand. 💯 Ok maybe 2nd only to the Birdcage 75th concept but this isn’t a concept model. There will be 62 of these made, and of course it’s already sold out ! Phenomenal job by @klausbusse and his team 🙌🏽

