One Last time… 🫡

Felt surreal to see my Project e36 in a car show setting again. A lot of old memories of going to car events with this car rushed back in, mostly the stress of getting the car ready lol. 😅😅

Thankful to everyone in making it possible to what could be the final and last show for the Project E36. 🙇🏽‍♂️🙇🏽‍♂️🙇🏽‍♂️ 

